$(document).ready(function() {
    $.material.init()
});
SocialShareKit.init();
jQuery(document).ready(function(a) {
    a(window).scroll(function() {
        if (a(this).scrollTop() > 50) {
            a("#keAtas").fadeIn("slow")
        } else {
            a("#keAtas").fadeOut("slow")
        }
    });
    a("#keAtas").click(function() {
        a("html, body").animate({
            scrollTop: 0
        }, 750);
        return false
    })
});